import React from "react";
import GroupData from "./Group.jsx";

const GroupListData = ({ groupData }) => {
    return (
        <>
            <div>
                {groupData.map((groupInfo) => {
                    return <GroupData groupData={groupInfo} />;
                })}
            </div>
        </>
    );
};

export default GroupListData;
